export default function Guesnum(props){
    function Check(props){
        console.log("1");
       return(
        <h1>{props.ran}</h1>
       )
    }
    return(
    <div>
        <div className="in">
           <input  className="input"  type="text" placeholder="Enter Number"/>
           <br></br><br/>
           <button onClick={Check(props={props})}>Check</button>
           <br></br><br/>
           <button>Restart</button>
        </div>
    </div>
    );
}
